(2, 2270, 'DEFAULT', 'Habbo Club', 172, '1', '0', 1, '0', 4, 'pets2', '[\"catalogus_klassiekemeubi_header\",\"catalogus_klassiekemeubi_teaser\"]', '[\"Bonitos muebles para tu habitación que pueden tener forma de club.\",\"Habbo Club\",\"Cuando nos abres verás un menú. Aquí puedes comprar cosas que pertenecen al Club Habbo.\",\"\"]', 0, '0', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
