(4, 2270, 'DEFAULT', 'Grupos', 203, '1', '1', 1, '0', 12, 'guild_frontpage', '[\"catalog_groups_es\",\"catalog_groupsteaser_es\"]', '[\"¡Crea aquí­ tu Grupo y demuéstrale a todo Habbo quién manda! ¿Estás listo para la aventura?\",\"Los grupos son una buena manera de mantenerse en contacto con sus amigos y compartir sus intereses con los demás. Cada grupo tiene un salón principal, el cual puede decorarse colectivamente o individualmente. Pueden hacer otras cosas como: <br>* Juntarse con sus amigos en una sala de reunión. <br>* Decorar la sala de reuniones.  <br>* Mostrar tu placa de grupos.  <br>* Seleccionar los colores de tu grupo.\", \"¿Qué tiene de bueno los grupos de Habbo?\"]', 0, '0', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 2270, 'DEFAULT', 'Furnis Clásicos', 206, '1', '0', 1, '0', 5, 'pets2', '[\"catalogus_klassiekemeubi_header\",\"catalogus_klassiekemeubi_teaser\"]', '[\"Bonitos muebles que podrías colocar en cada habitación.\",\"Muebles clasicos\",\"Tienes muchas opciones. Desplácese hacia abajo para ver el menú completo.\",\"\"]', 0, '0', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
