(9, 2270, 'DEFAULT', 'Wired', 1465, '1', '0', 1, '0', 13, 'pets2', '[\"catalogus_wiredshop_header\",\"catalogus_wiredshop_teaser\"]', '[\"Cableado tiene infinitas funciones. Tienes muchas cosas que hacer con esto\", \"¿Cómo funciona el cableado?\", \"Para hacer el trabajo cableado, necesitas 3 tipos de cableado.\r\n\r\n1. Disparadores: cosas que debes hacer para que un efecto funcione.\r\n\r\n2. Efectos: cosas que suceden después de activar un disparador.\r\n\r\n3. Condiciones (opcional): el ejemplo debe existir antes de que funcione el activador.\r\n\r\nAsí que la suma es: Trigger + Effect + Condition = Wired! \",\" Si aún no lo entiendes, puedes preguntar a otros Hillos si quieren ayudarte con esto \"]', 0, '0', 'wired_shop', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
