(135, 8, 'DEFAULT', 'Banzia explicación', 42, '1', '1', 1, '0', 1, 'pets2', '[\"banzai\",\"banzai1\"]', '[\"¿Cómo funciona? ¡Lee bien las instrucciones aquí y jugarás a Banzai en unos minutos!\",\"Cómo hacer tu propia arena Banzai:\",\"1. En su sala, coloque los cuadros de Banzai en el piso y ciérrelos con paredes.\r\n\r\n2. Coloque un portal para cada equipo (máx. 4: azul, rosado, amarillo y verde)\r\n\r\n3. Coloca un contador y un tablero de puntuación en el campo de juego.\r\n\r\n4. Haga clic en el contador para iniciar el juego!\r\n\r\n5. Salta sobre un cuadro Banzai para darle tu color, salta x3 en el cuadro Banzai para mantener tu color: ¡el equipo con más puntos gana!\",\"Sugerencia: agregue drama con pirámides, dragones y discos: ¡funcionan como obstáculos y ayudantes!\"]', 0, '0', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(136, 8, 'DEFAULT', 'Battle Banzai', 78, '1', '1', 1, '0', 2, 'default_3x3', '[\"banzai\",\"banzai1\"]', '[\"¿Más grande? ¿Mejor? ¡Banzai! Ahora tú eres quien decide las reglas de tu propio juego de Battle Banzai, el que montes en una de tus Salas Privadas. ¡Tú tienes el poder!\"]', 0, '0', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(137, 8, 'DEFAULT', 'Freeze explicación', 42, '1', '1', 1, '0', 3, 'pets2', '[\"freeze\",\"freeze3\"]', '[\"¿Cómo se juega? ¡Lee bien las instrucciones aquí y jugarás a Freeze en unos minutos!\",\"¿Cómo juegar Freeze?\",\"1. Coloca baldosas y bloques en tu habitación. (¡Siempre coloca los bloques sobre las baldosas!) Coloque la entrada del equipo, un contador, una salida y un tablero de puntuación.\r\n\r\n2. ¿Listo? Deja que tus amigos elijan un equipo. Cada equipo puede tener un máximo de 5 jugadores. ¡Haga clic en el contador para comenzar!\r\n\r\n3. Para hacer una bola de nieve, haga doble clic en la casilla donde está parado/a o en alguna que esté a su lado. ¡Haz explotar bloques para los power-ups!\r\n\r\n4. ¡El último equipo que quede gana!\",\"Recuerde: se le envía a la salida cuando pierde y no tiene más vidas.\"]', 0, '0', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(138, 8, 'DEFAULT', 'Freeze', 87, '1', '1', 1, '0', 4, 'default_3x3', '[\"freeze\",\"freeze1\"]', '[\"Seguro que después de participar en este juego ya no te gustará tanto la nieve... Compite por equipos y consigue que impacten el mayor números de bolas de nieves posibles sobre tus rivales.\"]', 0, '0', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
