(2190, 2052, 'DEFAULT', 'Tienda de mascotas', 24, '1', '0', 1, '0', 2, 'pets3', '[\"catalogus_huisdieren_header\",\"ctlg_pet_note\"]', '[\"Huisdieren zijn ook inwoners van Hillo Hotel, dus elke huisdier eigenaar moet er wat over weten. Als u goed voor uw huisdier wilt zorgen, lees dan zorgvuldig de volgende punten.\r\n\",\"Een paar dingen die je moet weten:\",\"*Je kan met je huisdier een wandeling maken in je eigen kamer of andere kamers.\r\n*Je kunt je huisdier niet ruilen, maar ze kunnen je volgen naar de kamers van vrienden om geaaid te worden.\r\n*Je kunt maximaal 50 huisdieren op je kamer hebben, maar zorg voor ze allemaal!\r\n\r\n\r\n*Een huisdier kan niet doodgaan.\r\n*Ontvang Badges en Achievement punten bij het trainen van je huisdier.\",\"Klik op je huisdier en druk op de knop \'\'Trainen\'\' om een lijst met opdrachten te krijgen waarmee je je huisdier in een mum van tijd kunt verbeteren!\"]', 0, '0', 'pets_shop', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
